import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from "react-router-dom";


const Menu = (let_logout) => {
    return (
        <nav>
            <ul className="header">
                <li>
                    <Link to='/'>
                        Users
                    </Link>
                </li>
                <li>
                    <Link to='/projects'>
                        Projects
                    </Link>
                </li>
                <li>
                    <Link to='/notes'>
                        Tasks
                    </Link>
                </li>'
                <li>
                    {/*<Link to='/login'>*/}
                    {let_logout}
                    {/*</Link>*/}
                </li>
            </ul>
        </nav>
    )
}

export default Menu
